import React from 'react'

import './SubmitBtn.scss'

const SubmitBtn = props => {
  return (
    <div className="formBtnContainer">
      <button onClick={props.handleSubmit} className="submitBtn">Let's go</button>
    </div>
  )
}

export default SubmitBtn
